-- ----------------------------
-- Table structure for regulation
-- ----------------------------
DROP TABLE IF EXISTS `regulation`;
CREATE TABLE `regulation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rule_name` varchar(30) NOT NULL,
  `describe` varchar(100) DEFAULT NULL,
  `belong_sys` smallint(6) DEFAULT NULL,
  `create_time` datetime NOT NULL,
  `create_user` varchar(10) NOT NULL,
  `table_info` longtext NOT NULL,
  `rule_template` varchar(100) NOT NULL,
  `extend1` varchar(255) DEFAULT NULL,
  `extend2` varchar(255) DEFAULT NULL,
  `extend3` varchar(255) DEFAULT NULL,
  `use_csr` smallint(6) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `rule_name` (`rule_name`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8;

